  render() {
    Aos.init();
    return (
       NewComponent = React.createClass({
        render: function() {
          return (
      
            <div className="container">
              <div className="card">
                <div className="content">
                  <h2>1</h2>
                  <h3>
                    card one</h3>
                  <p>ahkgdouaguags</p>
